import React, { Component } from 'react';


export default class ProductHeader extends Component {
    render() {
        const powderStyle = {
            background: "red",
            paddingRight: "3em"
        }

        if (this.props.currPage === 'detox') {
            return (
                <h3 className="productName">
                    <p>TOTAL CLEANSER </p>
                    <p>3DAYS</p>
                </h3>
            )
        } else if (this.props.currPage === 'powder') {
            return (
                <h3 className="productName">
                    <p style={powderStyle}>CLEANSE  </p>
                    <p>POWDER</p>
                </h3>
            )
        }  else {
            return (
                <h3 className="productName">
                    <p>AFTER CLEANSE</p>
                    <p>SMOOTHIE</p>
                </h3>
            )
        }


      }
  }
